import React, { Component } from 'react';
import './Styles/Heading.css'

class Heading extends Component {
    render() {
        return (
            <div id="Heading">
                <div><h1 id="HeadingTExt">Maaxo</h1></div>
            </div>
        );
    }
}

export default Heading;
